import "./App.css";

function App() {
  const clickMe = () => {
    document.location.href("/");
  };
  return (
    <div className="App">
      <header className="App-header">
        <h1 className="title">seunchoi's website</h1>
        <button className="btn" onClick={clickMe}>
          Wordpress Blog
        </button>
        <button className="btn">Adminer</button>
      </header>
    </div>
  );
}

export default App;
